import httpAgent from '../httpAgent';
/**
 * 页面名_模块名_类型名
 */
const comState = {
    com_label_integer: async (action) => {
        const post_view_list = await httpAgent({url: '/user/getUserView', method: 'post' , params: {
            id: action.com_label_integer
        }});
        return {
            default: 0,
            type: 'comLabelInteger',
            data: {
                com_label_integer: Number(action?action.com_label_integer:0),
                post_view_list: post_view_list.data
            }
        }
    }
}

export default comState;
